import React, { Component } from "react";
import { WriterWrapper, WriterItem } from "../style";
import { connect } from "react-redux";

class Writer extends Component {
  componentDidMount() {
    console.log("hello world");
  }
  render() {
    return (
      <WriterWrapper>
        <WriterItem>
          {this.props.list}
          <img
            src="https://upload.jianshu.io/users/upload_avatars/2631077/dc99c361412c?imageMogr2/auto-orient/strip|imageView2/1/w/96/h/96/format/webp"
            alt=""
          />
          <div className="info">
            <h5>1</h5>
            <p>2</p>
          </div>
        </WriterItem>
      </WriterWrapper>
    );
  }
}

const mapState = state => ({
  list: state.getIn(["home", "writerList"]),
  page: state.getIn(["home", "writerPage"]),
  writeTotal: state.getIn(["home", "writeTotal"])
});

const mapDispatch = dispatch => ({});

export default connect(
  mapState,
  mapDispatch
)(Writer);
